import {makeStyles} from '@material-ui/core/styles'


export const useStyles = makeStyles((theme) => ({
    root: {
        width: '400px',
        height: '300px',
        backgroundColor: theme.palette.primary.white,
        '& > div.form-btns': {
            display: 'flex'
        }
    },
    menu: {
        width: '50px'
    }
}))
